import React from 'react';
import "./styles.scss";

export class Payload extends React.Component{
    constructor(props){
        super(props);
        console.log(props);
        this.state = {
            payloads: props.payloads
        }
    }

    render(){
        //console.log(this.state.payloads);
        const payloadMap = this.state.payloads.map((payload) => {
            return (<li>
                    <p>ID: {payload.payload_id}
                    Type: {payload.payload_type}
                    Nationality: {payload.nationality}</p>

                </li>
            );
        })
        return(
            <div className="payloads">
                <ol>

                {payloadMap}

                </ol>
            </div>
        )
    }
}
